import React, { useState } from 'react';

const PathGuider = () => {
  const [selectedSlot, setSelectedSlot] = useState(null);
  const [allPaths, setAllPaths] = useState([]);
  const [bestPath, setBestPath] = useState(null);

  // Mock parking lot layout (10x8 grid)
  const parkingLot = Array(8).fill().map((_, row) => 
    Array(10).fill().map((_, col) => ({
      id: `${row}-${col}`,
      x: col,
      y: row,
      isSlot: Math.random() > 0.3,
      isOccupied: Math.random() > 0.7,
      isEntrance: row === 7 && col === 0
    }))
  );

  // Generate random paths with metrics
  const generatePaths = (targetSlot) => {
    if (!targetSlot) return [];

    const numPaths = Math.floor(Math.random() * 4) + 3; // 3-6 paths
    const paths = [];

    for (let i = 0; i < numPaths; i++) {
      const distance = Math.floor(Math.random() * 150) + 50; // 50-200m
      const tJunctions = Math.floor(Math.random() * 8) + 1; // 1-8 junctions
      const trafficIntensity = Math.floor(Math.random() * 100) + 1; // 1-100%
      
      // Generate path coordinates
      const pathCoords = generatePathCoords(targetSlot, distance);
      
      paths.push({
        id: i + 1,
        distance,
        tJunctions,
        trafficIntensity,
        coordinates: pathCoords,
        score: calculatePathScore(distance, tJunctions, trafficIntensity)
      });
    }

    return paths.sort((a, b) => a.score - b.score);
  };

  const generatePathCoords = (targetSlot, distance) => {
    const coords = [{ x: 0, y: 7 }]; // Start at entrance
    const steps = Math.floor(distance / 20);
    
    for (let i = 1; i < steps; i++) {
      const prevCoord = coords[i - 1];
      
      coords.push({
        x: Math.round(prevCoord.x + (targetSlot.x - prevCoord.x) * 0.3 + Math.random() * 2 - 1),
        y: Math.round(prevCoord.y + (targetSlot.y - prevCoord.y) * 0.3 + Math.random() * 2 - 1)
      });
    }
    
    coords.push(targetSlot); // End at target
    return coords;
  };

  const calculatePathScore = (distance, tJunctions, trafficIntensity) => {
    // Lower score is better
    return (distance * 0.4) + (tJunctions * 15) + (trafficIntensity * 0.8);
  };

  const handleSlotClick = (slot) => {
    if (slot.isSlot && !slot.isOccupied && !slot.isEntrance) {
      setSelectedSlot(slot);
      const paths = generatePaths(slot);
      setAllPaths(paths);
      setBestPath(paths[0]);
    }
  };

  const getSlotColor = (slot) => {
    if (slot.isEntrance) return 'bg-green-500';
    if (!slot.isSlot) return 'bg-gray-800';
    if (slot.isOccupied) return 'bg-red-500';
    if (selectedSlot && slot.id === selectedSlot.id) return 'bg-yellow-400';
    return 'bg-blue-400';
  };

  const getPathColor = (pathId, isBest) => {
    if (isBest) return '#00ff88';
    const colors = ['#ff6b6b', '#4ecdc4', '#45b7d1', '#96ceb4', '#ffeaa7'];
    return colors[pathId % colors.length];
  };

  const getIntensityColor = (intensity) => {
    if (intensity < 30) return 'text-green-400';
    if (intensity < 70) return 'text-yellow-400';
    return 'text-red-400';
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-900 via-blue-900 to-indigo-900 p-6">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-white mb-2 flex items-center justify-center gap-3">
            <span className="text-cyan-400">üß≠</span>
            Smart Parking Pathfinder
            <span className="text-green-400">üöó</span>
          </h1>
          <p className="text-cyan-200 text-lg">Find the optimal path to your parking slot</p>
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          {/* Parking Lot Visualization */}
          <div className="lg:col-span-2">
            <div className="bg-black/30 backdrop-blur-lg rounded-2xl p-6 border border-cyan-400/20">
              <h2 className="text-2xl font-bold text-white mb-4 flex items-center gap-2">
                <span className="text-cyan-400">üìç</span>
                Parking Lot Layout
              </h2>
              
              <div className="relative bg-gray-900 rounded-xl p-4 overflow-hidden">
                {/* Grid */}
                <div className="grid grid-cols-10 gap-1 mb-4">
                  {parkingLot.flat().map((slot) => (
                    <div
                      key={slot.id}
                      className={`
                        w-8 h-8 rounded cursor-pointer transition-all duration-300 transform hover:scale-110
                        ${getSlotColor(slot)}
                        ${slot.isSlot && !slot.isOccupied && !slot.isEntrance ? 'hover:shadow-lg hover:shadow-cyan-400/50' : ''}
                      `}
                      onClick={() => handleSlotClick(slot)}
                      title={
                        slot.isEntrance ? 'Entrance' :
                        !slot.isSlot ? 'Wall' :
                        slot.isOccupied ? 'Occupied' :
                        'Available Slot'
                      }
                    />
                  ))}
                </div>

                {/* Path Visualization */}
                <svg className="absolute inset-0 w-full h-full pointer-events-none">
                  {allPaths.map((path, index) => (
                    <g key={path.id}>
                      <path
                        d={`M ${path.coordinates.map(coord => `${coord.x * 36 + 32} ${coord.y * 36 + 32}`).join(' L ')}`}
                        stroke={getPathColor(path.id, path.id === bestPath?.id)}
                        strokeWidth={path.id === bestPath?.id ? "4" : "2"}
                        fill="none"
                        strokeDasharray={path.id === bestPath?.id ? "0" : "5,5"}
                        opacity={path.id === bestPath?.id ? "1" : "0.6"}
                        className="animate-pulse"
                      />
                    </g>
                  ))}
                </svg>

                {/* Legend */}
                <div className="mt-4 flex flex-wrap gap-4 text-sm">
                  <div className="flex items-center gap-2">
                    <div className="w-4 h-4 bg-green-500 rounded"></div>
                    <span className="text-white">Entrance</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <div className="w-4 h-4 bg-blue-400 rounded"></div>
                    <span className="text-white">Available</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <div className="w-4 h-4 bg-red-500 rounded"></div>
                    <span className="text-white">Occupied</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <div className="w-4 h-4 bg-yellow-400 rounded"></div>
                    <span className="text-white">Selected</span>
                  </div>
                  <div className="flex items-center gap-2">
                    <div className="w-4 h-4 bg-gray-800 rounded"></div>
                    <span className="text-white">Wall</span>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* Path Analysis Panel */}
          <div className="space-y-6">
            {/* Best Path Card */}
            {bestPath && (
              <div className="bg-gradient-to-r from-green-500/20 to-cyan-500/20 backdrop-blur-lg rounded-2xl p-6 border border-green-400/30">
                <h3 className="text-xl font-bold text-white mb-4 flex items-center gap-2">
                  <span className="text-green-400">‚ö°</span>
                  Optimal Path
                </h3>
                <div className="space-y-3">
                  <div className="flex justify-between items-center">
                    <span className="text-green-300">Distance:</span>
                    <span className="text-white font-bold">{bestPath.distance}m</span>
                  </div>
                  <div className="flex justify-between items-center">
                    <span className="text-green-300">T-Junctions:</span>
                    <span className="text-white font-bold">{bestPath.tJunctions}</span>
                  </div>
                  <div className="flex justify-between items-center">
                    <span className="text-green-300">Traffic:</span>
                    <span className={`font-bold ${getIntensityColor(bestPath.trafficIntensity)}`}>
                      {bestPath.trafficIntensity}%
                    </span>
                  </div>
                  <div className="flex justify-between items-center pt-2 border-t border-green-400/30">
                    <span className="text-green-300">Score:</span>
                    <span className="text-green-400 font-bold">{bestPath.score.toFixed(1)}</span>
                  </div>
                </div>
              </div>
            )}

            {/* All Paths List */}
            <div className="bg-black/30 backdrop-blur-lg rounded-2xl p-6 border border-cyan-400/20">
              <h3 className="text-xl font-bold text-white mb-4 flex items-center gap-2">
                <span className="text-cyan-400">üõ£Ô∏è</span>
                All Possible Paths
              </h3>
              
              {allPaths.length === 0 ? (
                <div className="text-center py-8">
                  <div className="text-6xl mb-3">üöó</div>
                  <p className="text-gray-400">Select a parking slot to see available paths</p>
                </div>
              ) : (
                <div className="space-y-3 max-h-96 overflow-y-auto">
                  {allPaths.map((path, index) => (
                    <div
                      key={path.id}
                      className={`
                        p-4 rounded-xl border transition-all duration-300 cursor-pointer
                        ${path.id === bestPath?.id 
                          ? 'bg-green-500/20 border-green-400' 
                          : 'bg-gray-800/50 border-gray-600 hover:border-cyan-400'
                        }
                      `}
                    >
                      <div className="flex justify-between items-center mb-2">
                        <span className="text-white font-bold">Path {path.id}</span>
                        {path.id === bestPath?.id && (
                          <span className="text-green-400 text-sm font-bold">BEST</span>
                        )}
                      </div>
                      <div className="grid grid-cols-2 gap-2 text-sm">
                        <div className="flex items-center gap-1">
                          <span className="text-cyan-400">‚è±Ô∏è</span>
                          <span className="text-gray-300">{path.distance}m</span>
                        </div>
                        <div className="flex items-center gap-1">
                          <span className="text-yellow-400">‚ö†Ô∏è</span>
                          <span className="text-gray-300">{path.tJunctions} T-J</span>
                        </div>
                        <div className="flex items-center gap-1">
                          <span className={getIntensityColor(path.trafficIntensity)}>üö¶</span>
                          <span className={getIntensityColor(path.trafficIntensity)}>
                            {path.trafficIntensity}%
                          </span>
                        </div>
                        <div className="text-right">
                          <span className="text-xs text-gray-400">Score: </span>
                          <span className="text-white font-bold">{path.score.toFixed(1)}</span>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>

            {/* Instructions */}
            <div className="bg-blue-500/20 backdrop-blur-lg rounded-2xl p-6 border border-blue-400/30">
              <h3 className="text-lg font-bold text-white mb-3">How to Use</h3>
              <ul className="text-blue-200 space-y-2 text-sm">
                <li>‚Ä¢ Click on any available (blue) parking slot</li>
                <li>‚Ä¢ View all possible paths with their metrics</li>
                <li>‚Ä¢ The optimal path is highlighted in green</li>
                <li>‚Ä¢ Lower scores indicate better paths</li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PathGuider;
